  <meta charset="UTF-8" />
  <link rel="icon" type="image/png" href="/calendar-analysis/assets/google-calendar-fe9519f5.png" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0" />
  <title>Calendar analysis</title>
  <script type="text/javascript">
    (function(l) {
      if (l.search[1] === '/' ) {
        var decoded = l.search.slice(1).split('&').map(function(s) { 
          return s.replace(/~and~/g, '&')
        }).join('?');
        var newPath = l.pathname.slice(0, l.pathname.lastIndexOf('/')) + decoded + l.hash;
        if (newPath !== l.href) {
          window.history.replaceState(null, null, newPath);
        }
      }
    }(window.location))
  </script>
